#https://leetcode.com/problems/minimum-window-substring

class Solution:
    def minWindow(self, s: str, t: str) -> str:
        ans = ""
        len_s = len(s)
        len_t = len(t)
        if len_s < len_t:
            return ans
        
        for i in range(len_s):
            tmpAns = ""

            if s[i] in t:
                tmpAns += s[i]
                if 1 == len_t:
                    if len(ans) == 0 or len(tmpAns) < len(ans):
                        ans = tmpAns 
                    break

                for j in range(i+1, len_s):
                    tmpAns += s[j]

                    if len(tmpAns) >= len_t:
                        tmpT = t[:]
                        for c in tmpAns:
                            tmpT = tmpT.replace(c, "", 1)
                        
                        if len(tmpT) != 0:
                            continue

                        if len(ans) == 0 or len(tmpAns) < len(ans):
                            ans = tmpAns 
                        
                        break
                     
        return ans

s = Solution()
print(s.minWindow("bbaa", "aba"), "baa")
print(s.minWindow("aab", "aab"), "aab")
print(s.minWindow("bba", "ab"), "ba")
print(s.minWindow("ADOBECODEBANC", "ABC"), "BANC")
print(s.minWindow("a", "a"), "a")
print(s.minWindow("a", "aa"), "")
print(s.minWindow("", ""), "")
